import React from "react";
import BootstrapTable from "react-bootstrap-table-next";
import "node_modules\react-bootstrap-table-nextdist\react-bootstrap-table2.css";

const data = [];

const columns = [
  {
    dataField: "id",
    text: "Product ID"
  },
  {
    dataField: "name",
    text: "Product Name"
  },
  {
    dataField: "price",
    text: "Product Price"
  }
];

export default class Table extends React.Component {
  render() {
    return (
      <div>
        <BootstrapTable keyField="id" data={data} columns={columns} />
      </div>
    );
  }
}
